function Experience() {
  return (
    <div className="experience-section flex flex-col ite gap-8 sm:flex md:flex-row">
      <div>
        <img src="images/5K.svg" />
        <h4>Happy Clients</h4>
      </div>
      <div>
        <img src="images/230 +.svg" />
        <h4>Moving Companies</h4>
      </div>
      <div>
        <img src="images/15.svg" />
        <h4>Years of experience</h4>
      </div>
    </div>
  );
}

export default Experience;
